import React from 'react';

import { NavLink } from 'react-router-dom';

import './Navigation.css';

const Navigation = (props) => {
  return (
    <div className='navigation'>
      <NavLink exact to='/'>
        Home
      </NavLink>
      <NavLink exact to='/login'>
        Login
      </NavLink>
      <NavLink exact to='/register'>
        Register
      </NavLink>
    </div>
  );
};

export default Navigation;
